window.bookSummaryJSON = "<p><b>From beloved author Nora Roberts comes the #1 </b><b><i>New York Times</i></b><b> bestseller about shattering loss and shocking discovery - set in a small town nestled in the Blue Ridge Mountains...</b></p> <p>When five-thousand-year-old human bones are found at a construction site in the small town of Woodsboro, the news draws archaeologist Callie Dunbrook out of her sabbatical and into a whirlwind of adventure, danger, and romance.</p> <p>While overseeing the dig, she must try to make sense of a cloud of death and misfortune that hangs over the project - fueling rumors that the site is cursed. She must cope with the presence of her irritating - but irresistible - ex-husband, Jake. And when a stranger claims to know a secret about her privileged Boston childhood, she must question her own past as well...</p>"; 
